import React, { useState } from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button,
} from '@material-ui/core';

const sampleData = [
  { id: 1, name: 'John Doe' },
  { id: 2, name: 'Jane Smith' },
  { id: 3, name: 'Alice Johnson' },
  { id: 4, name: 'Bob Williams' },
  { id: 5, name: 'Charlie Brown' },
  { id: 6, name: 'David Lee' },
  { id: 7, name: 'Emily Davis' },
  { id: 8, name: 'Frank Wilson' },
  { id: 9, name: 'Grace Thompson' },
  { id: 10, name: 'Henry Anderson' },
  // Add more sample data here
];

const TableComponent = () => {
  const [data, setData] = useState(sampleData.slice(0, 10));

  const handleButtonClick = () => {
    const newData = [...data, ...sampleData.slice(data.length, data.length + 5)];
    setData(newData);
  };

  return (
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>ID</TableCell>
            <TableCell>Name</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {data.map((row) => (
            <TableRow key={row.id}>
              <TableCell>{row.id}</TableCell>
              <TableCell>{row.name}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
      <Button onClick={handleButtonClick}>Show 15 Data</Button>
    </TableContainer>
  );
};

export default TableComponent;
